### Welcome to a tool created by OrbitronDev.
Using this tool, gives you the ability to hack agar.io easily. And the best part is, its FREE and OPEN SOURCE.
To start with it click `F12` on your keyboard and search for `Console` or similar things. Copy and Paste the code below and hit enter to start.

```javascript
var agario_hack = document.createElement('script');
agario_hack.async = true;
agario_hack.type = 'text/javascript';
agario_hack.src = '//d3strukt0rlp.github.io/agario-hack/agario-hack.js';
var node = document.getElementsByTagName('script')[0];
node.parentNode.insertBefore(agario_hack, node);
```

